export enum NoteStatus {
    Personal = 'Personal',
    Shared = 'Shared',
    Public = 'Public'
}

export interface Note {
    id: number;
    title: string;
    content: string;
    category: string;
    createdAt: Date;
    updatedAt: Date;
    userId: number;
    isPublic: boolean;
    status: NoteStatus;
    user?: User;
}

export interface User {
    id: number;
    username: string;
    email: string;
    createdAt: Date;
    // Add uppercase variants for C# compatibility
    Id?: number;
    Username?: string;
    Email?: string;
    CreatedAt?: Date;
}

export interface NoteApiResponse {
    id: number;
    title: string;
    content: string;
    category: string;
    createdAt: string;  // API returns dates as strings
    updatedAt: string;
    userId: number;
    isPublic: boolean;
    status: NoteStatus;
    user?: User;
}

// Helper function to convert API response to Note
export const convertApiResponseToNote = (apiNote: NoteApiResponse): Note => ({
    id: apiNote.id,
    title: apiNote.title,
    content: apiNote.content,
    category: apiNote.category,
    createdAt: new Date(apiNote.createdAt),
    updatedAt: new Date(apiNote.updatedAt),
    userId: apiNote.userId,
    isPublic: apiNote.isPublic,
    status: apiNote.status,
    user: apiNote.user
});
